import React from 'react';
import Context from '../../config/Context';

const AddToPortalButton = () => {
    return (
      <Context.Consumer>
        {context => (
          <div>
            <button type="button"

              className="form-button button-blue button-fullWidth"
              name="addToPortal">
              Add this user to your portals
            </button>
          </div>
        )}
      </Context.Consumer>
  );
}
export default AddToPortalButton;
